import axios from "axios";
import './App.css';
import {useEffect, useState} from "react";

function App() {
    let arr=[];
    const [loading, setloading]=useState(false);
    useEffect(async ()=>{
        arr=[
            (await axios.get("https://api.music.msub.kr/?song=Life%20is%20Good")).data.lineup
        ]
        setloading(true);
    }, []);

    if(!loading) return null;
  return (
      <div>
          {arr[0]}
      </div>
  );
}

export default App;
